import React, { Component } from "react";
import Card from "../Component/Card/card";

export default class Home extends Component {
  render() {
    return (
      <div class="container mt-5">
        <div class="row mrb-10">
          <div class="col-sm-12 col-md-3">
            <Card
              imgs={"./images/skin.gif"}
              title={" Structure of Cell"}
              text={
                " A cell is the smallest living thing in the human organism, and all living structures in the human body are made of cells. There are hundreds of different types of cells in the human body, which vary in shape (e.g. round, flat, long and thin, short and thick) and size (e.g. small granule cells of the cerebellum in the brain (4 micrometers), up to the huge oocytes (eggs) produced in the female reproductive organs (100 micrometers) and function."
              }
              link={"/second_page1"}
            />
          </div>

          <div class="col-sm-12 col-md-3 mrt-10">
            <Card
              imgs={"./images/lymphatic system.gif"}
              title={"Lymphatic System"}
              text={
                " The lymphatic system is a network of tissues, vessels and organs that work together to move a colorless, watery fluid called lymph back into your circulatory system. Some 20 liters of plasma flow through your body’s arteries and smaller arteriole blood vessels and capillaries every day. The lymphatic system collects this excess fluid, now called lymph, from tissues in your body and moves it along until it's ultimately returned to your bloodstream."
              }
              link={"/second_page"}
            />
          </div>
          <div class="col-sm-12 col-md-3 mrt-10">
            <Card
              imgs={"./images/eye.gif"}
              title={"Human Eye Anatomy"}
              text={
                "The human eye is an organ that reacts to light in many circumstances. As a conscious sense organ, the human eye allows vision; rod and cone cells in the retina allow conscious light perception and vision, including color differentiation and the perception of depth. The human eye can distinguish about 10 million colors. ."
              }
              link={"/second_page2"}
            />
          </div>
          <div class="col-sm-12 col-md-3 mrt-10">
            <Card
              imgs={"./images/ear.gif"}
              title={"Hunam Ear Anatomy"}
              text={
                " A feeler gauge or a gap gauge is a tool - or, more commonly, a set of tools - used to check the width of small gaps between objects placed very close together. "
              }
              link={"/second_page2"}
            />
          </div>
        </div>
        <div class="row mt-5 mb-5 mrbt-10">
          <div class="col-sm-12 col-md-3 mrt-10">
            <Card
              imgs={"./images/heart-only.gif"}
              title={"Human Heart Anatomy"}
              text={
                " Comming Soon"
              }
              link={"/second_page3"}
            />
          </div>

          <div class="col-sm-12 col-md-3 mrt-10">
            <Card
              imgs={"./images/cardiovascular.gif"}
              title={"Cardiovascular System"}
              text={
                " Comming Soon"
              }
              link={"/second_page"}
            />
          </div>

          <div class="col-sm-12 col-md-3 mrt-10">
            <Card
              imgs={"./images/giphy.gif"}
              title={"The Skeletal System"}
              text={
                " Comming Soon"
              }
              link={"/second_page"}
            />
          </div>
          <div class="col-sm-12 col-md-3 mrt-10">
            <Card
              imgs={"./images/muscular system.gif"}
              title={"Muscular System"}
              text={
                " 5/2-way valves are used to actuate double acting pneumatic actuators, such as pneumatic cylinders, rodless cylinders, grippers and rotary actuators."
              }
            />
          </div>
        </div>
        <div class="row mt-5 mb-5 mrbt-10">
          <div class="col-sm-12 col-md-3 mrt-10">
            <Card
              imgs={"./images/brain.gif"}
              title={"Human Brain Anatomy"}
              text={
                " Lathes are one of the most versatile machine tools in the industry, used to perform a variety of machining operations( Ex Facing, Tapering& Boring etc)."
              }
              link={"/second_page1"}
            />
          </div>
          <div class="col-sm-12 col-md-3 mrt-10">
            <Card
              imgs={"./images/dental.gif"}
              title={"Dental Anatomy"}
              text={
                " 5/2-way valves are used to actuate double acting pneumatic actuators, such as pneumatic cylinders, rodless cylinders, grippers and rotary actuators."
              }
              link={"/second_page"}
            />
          </div>
          <div class="col-sm-12 col-md-3 mrt-10">
            <Card
              imgs={"./images/respiratory.gif"}
              title={"The Respiratory System"}
              text={
                " 5/2-way valves are used to actuate double acting pneumatic actuators, such as pneumatic cylinders, rodless cylinders, grippers and rotary actuators."
              }
              link={"/second_page"}
            />
          </div>

          <div class="col-sm-12 col-md-3 mrt-10">
            <Card
              imgs={"./images/renal.gif"}
              title={"The Renal System"}
              text={
                " 5/2-way valves are used to actuate double acting pneumatic actuators, such as pneumatic cylinders, rodless cylinders, grippers and rotary actuators."
              }
              link={"/second_page"}
            />
          </div>
        </div>
        <div class="row mt-5 mb-5 mrbt-10">
          <div class="col-sm-12 col-md-3 mrt-10">
            <Card
              imgs={"./images/kidney.gif"}
              title={"Kidney Anatomy"}
              text={
                " 5/2-way valves are used to actuate double acting pneumatic actuators, such as pneumatic cylinders, rodless cylinders, grippers and rotary actuators."
              }
              link={"/second_page"}
            />
          </div>

          <div class="col-sm-12 col-md-3 mrt-10">
            <Card
              imgs={"./images/Liver.gif"}
              title={"Liver Anatomy"}
              text={
                " 5/2-way valves are used to actuate double acting pneumatic actuators, such as pneumatic cylinders, rodless cylinders, grippers and rotary actuators."
              }
              link={"/second_page"}
            />
          </div>

          <div class="col-sm-12 col-md-3 mrt-10">
            <Card
              imgs={"./images/digestive system.gif"}
              title={"Digestive System"}
              text={
                " 5/2-way valves are used to actuate double acting pneumatic actuators, such as pneumatic cylinders, rodless cylinders, grippers and rotary actuators."
              }
              link={"/second_page"}
            />
          </div>
          <div class="col-sm-12 col-md-3 mrt-10">
            <Card
              imgs={"./images/skin.gif"}
              title={"Anatomy Of The Skin"}
              text={
                " 5/2-way valves are used to actuate double acting pneumatic actuators, such as pneumatic cylinders, rodless cylinders, grippers and rotary actuators."
              }
              link={"/second_page"}
            />
          </div>
        </div>{" "}
        <div class="row mt-5 mb-5 mrbt-10">
          <div class="col-sm-12 col-md-3 mrt-10">
            <Card
              imgs={"./images/reproductive.gif"}
              title={"Reproductive System"}
              text={
                " 5/2-way valves are used to actuate double acting pneumatic actuators, such as pneumatic cylinders, rodless cylinders, grippers and rotary actuators."
              }
              link={"/second_page"}
            />
          </div>
          <div class="col-sm-12 col-md-3 mrt-10"></div>
          <div class="col-sm-12 col-md-3 mrt-10"></div>
          <div class="col-sm-12 col-md-3 mrt-10"></div>
        </div>
      </div>
    );
  }
}
